Saya lebih fokus baca komentar dari 52ribu komentar, Cuma dua Nama Yang paling banyak diperbincangkan dan didukung. 1 . Anies 2. Prabowo , ada beberapa kesimpulan saya;

1. Masyarakat Indonesia Semakin Cerdas dan Peduli.
2. Cuma Pendukung Anies dan Prabowo yang paling banyak yang  nonton edukasi begini. Berarti pendukung Anies dan Prabowo adalah orang-orang Cerdas
